
-- Logistics & Supply Chain Analytics (PostgreSQL)
-- Generated sample dataset (random realistic)
-- Tables: regions, warehouses, products, suppliers, inventory, receipts, orders, shipments

BEGIN;

CREATE TABLE IF NOT EXISTS regions (
    region_id SERIAL PRIMARY KEY,
    region_name TEXT NOT NULL,
    country TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS warehouses (
    warehouse_id SERIAL PRIMARY KEY,
    region_id INTEGER REFERENCES regions(region_id),
    code TEXT UNIQUE NOT NULL,
    capacity INTEGER NOT NULL,
    current_stock INTEGER NOT NULL,
    last_updated TIMESTAMP NOT NULL
);

CREATE TABLE IF NOT EXISTS products (
    product_id SERIAL PRIMARY KEY,
    sku TEXT UNIQUE NOT NULL,
    name TEXT NOT NULL,
    category TEXT,
    weight_kg NUMERIC(6,3),
    cost_price NUMERIC(12,2),
    sale_price NUMERIC(12,2)
);

CREATE TABLE IF NOT EXISTS suppliers (
    supplier_id SERIAL PRIMARY KEY,
    name TEXT NOT NULL,
    country TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS inventory (
    inventory_id SERIAL PRIMARY KEY,
    product_id INTEGER REFERENCES products(product_id),
    warehouse_id INTEGER REFERENCES warehouses(warehouse_id),
    stock_qty INTEGER NOT NULL,
    last_restock_date DATE
);

CREATE TABLE IF NOT EXISTS receipts (
    receipt_id SERIAL PRIMARY KEY,
    supplier_id INTEGER REFERENCES suppliers(supplier_id),
    warehouse_id INTEGER REFERENCES warehouses(warehouse_id),
    product_id INTEGER REFERENCES products(product_id),
    received_qty INTEGER NOT NULL,
    received_date DATE NOT NULL,
    cost_per_unit NUMERIC(12,2) NOT NULL
);

CREATE TABLE IF NOT EXISTS orders (
    order_id SERIAL PRIMARY KEY,
    product_id INTEGER REFERENCES products(product_id),
    warehouse_id INTEGER REFERENCES warehouses(warehouse_id),
    order_date TIMESTAMP NOT NULL,
    quantity INTEGER NOT NULL,
    total_amount NUMERIC(12,2) NOT NULL,
    status TEXT NOT NULL
);

CREATE TABLE IF NOT EXISTS shipments (
    shipment_id SERIAL PRIMARY KEY,
    product_id INTEGER REFERENCES products(product_id),
    source_warehouse INTEGER REFERENCES warehouses(warehouse_id),
    dest_warehouse INTEGER REFERENCES warehouses(warehouse_id),
    ship_date TIMESTAMP NOT NULL,
    arrival_date TIMESTAMP,
    status TEXT NOT NULL,
    shipped_qty INTEGER NOT NULL
);

-- Some helper enums via CHECKs could be added but kept simple.



